    return (
        <>
        {result && result.items.map((item)=>
        <figure class="image is-16by9">
        <iframe class="has-ratio" width="640" height="360" src={"https://www.youtube.com/embed/"+item.id.videoId} frameborder="0" allowfullscreen></iframe>
      </figure>
        )}
        </>
    );
}

